import React from 'react';
import './App1.css';

function signup_form() {
    return (
      <>
        <div class="signup-form">
            <form>
                <h2>Sign Up</h2>
                <p>Please fill in this form to create an account!</p>
                <hr/>
                
                
                
            </form>
        </div>
      </>
    );
  }

export default signup_form;
